docs = split_into_sentences(paragraph)
count_model = CountVectorizer(ngram_range=(1,1)) # default unigram model
X = count_model.fit_transform(docs)
Xc = (X.T * X) # this is co-occurrence matrix in sparse csr format
Xc.setdiag(0) # sometimes you want to fill same word cooccurence to 0
Xc_dense = Xc.todense()
node_array = []
for word in count_model.vocabulary_:
    id_number = count_model.vocabulary_[word]
    id_number = np.asscalar(np.int16(id_number))
    node_element = {"id":id_number,"label":word}
    node_array.append(node_element)

edge_array = []
for i in range(0,1480):
    for j in range(i + 1,1480):
        connection_value = Xc_dense[i,j]
        if connection_value > 1:
            edge_element = {"from": i, "to": j, "label": np.asscalar(np.int16(connection_value))}
            edge_array.append(edge_element)

data = {}
data["nodes"] = node_array
data["edges"] = edge_array
json_data = json.dumps(data,encoding='UTF-8',default=str)
with open('fuck_word_graph_connection_greater_than_1.txt','w') as outfile:
    json.dump(data,outfile)
